var AutoList=MediumEditor.Extension.extend({name:"autolist",init:function(){this.subscribe("editableKeypress",this.onKeypress.bind(this))},onKeypress:function(e){if(MediumEditor.util.isKey(e,[MediumEditor.util.keyCode.SPACE])){var t=this.base.getSelectedParentElement().textContent;"1."==t?(this.base.execAction("insertorderedlist"),this.base.getSelectedParentElement().textContent=this.base.getSelectedParentElement().textContent.slice(2).trim()):"*"==t&&(this.base.execAction("insertunorderedlist"),this.base.getSelectedParentElement().textContent=this.base.getSelectedParentElement().textContent.slice(1).trim())}}});